// Navigation.js

import React from "react";
import "./navigation.css";
import { Link } from "react-router-dom";

export const Navigation = () => {
    const navContainerStyle = {
        backgroundColor: "#2196f3", // Blue background color
        color: "#fff",
        padding: "15px",
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
      };
    
      const logoStyle = {
        margin: "0",
        fontSize: "14px",
      };
    
      const navlinksStyle = {
        display: "flex",
      };
    
      const navButtonStyle = {
        margin: "0",
        padding: "10px",
        color: "#fff",
        backgroundColor: "#1565c0", // Blue button color
        borderRadius: "15px",
        border: "none",
        textDecoration: "none",
        cursor: "pointer",
      };
    
      const navButtonHoverStyle = {
        backgroundColor: "#FF0000", // Red background color on hover
        borderRadius: "15px",
      };
  return (
    <div style={navContainerStyle}>
      <h1 style={h1Style}>DOCTOR</h1>
      <div style={navigationStyle}>
        <Link to="/DoctorAppointment">
          <button style={navButtonStyle}>APPOINTMENT</button>
        </Link>
        <Link to="/DoctorChat">
          <button style={navButtonStyle}>CHAT</button>
        </Link>
        <Link to="/DocterMedicene">
          <button style={navButtonStyle}>MEDICINE</button>
        </Link>
        <Link to="/">
          <button style={{ ...navButtonStyle, ...navButtonHoverStyle }}>
            Logout
          </button>
        </Link>
      </div>
    </div>
  );
};
